import { fetchAPI } from "../api/api";

const Register = () => {
        useEffect(() => {fetchAPI("users/register").then((result) => {
            console.log(result);
        })}, []);
        return (
        <form id="registerForm">
            <input />
            <input type="password" minLength="8" required/>
            <input />
        </form>
    )
}

export default Register;
